column8:
スフォデラート(裏地なし)のフィンガーレス・ドライビンググローブ。手の甲側はコットン製メッシュ素材で高い伸縮性と通気性を実現。手のひら側にもパンチングホールを設け通気性を向上しています。柔らかくステアリングに馴染むラムレザーを使用しています。<br>
「Motorimodaオリジナルグローブ」です。ライディング用とドライビング用の2種類を用意。ドライビング用には3モデルをラインナップしました。6 Wheels Lifeを楽しむ我々にとって、グローブはマストアイテムと言えるでしょう。<br>
これらのグローブは、イタリア・ナポリ製。オールハンドメイドです。じつはナポリは、ヨーロッパでも有数の手袋の街なのです。<br>
19世紀初頭、経済的に厳しかったナポリ市民はフランスに移住。多くの人が手袋工場で職に就き、その高い技術を身につけたそうです。その職人たちはナポリの経済状況安定とともに故郷に戻り、ナポリで手袋生産を開始。現在に至るという訳です。<br>
ナポリの中心地には現在も「VIA GUANTAI NUOVI／新手袋通り」という名称が残り、ナポリ産グローブはいまもイタリアンモードを支えているのです。 <style type="text/css">
